app.controller("AnimationEditorController",["$rootScope",function(a){a.AnimationEditor=null;a.rows=1;a.cols=1;a.data={images:[],image:null};a.init=function(){require(["AnimationEditor"],function(b){a.AnimationEditor=b;a.$apply();a.AnimationEditor.initialize()});a.page.title="Editor de Animações"};a.changeRows=function(b){a.rows=b;a.AnimationEditor.rowsChange(b)};a.changeCols=function(b){a.cols=b;a.AnimationEditor.colsChange(b)};a.addImages=function(b){a.data.images=a.data.images.concat(b)};a.changeGraphic=function(){a.AnimationEditor.changeGraphic(a.data.image.url)}}]);